import React, { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import { getEnrollments } from "../features/enrollmentSlice";
import Card from "../components/Card";
import styles from "../styles/Dashboard.module.css";
import { getClassroom } from "../features/classroomSlice";

function EnrollmentsList() {
  const enrollments = useSelector((state) => state.enrollments.enrollments);
  const classrooms = useSelector((state) => state.classroom.classrooms);

  const { userId, token, is_teacher } = useSelector((state) => state.auth);
  console.log(token);
  console.log(userId);
  const dispatch = useDispatch();
  console.log(is_teacher);

  useEffect(() => {
    if (is_teacher === true) {
      dispatch(getClassroom(token, userId));
      console.log("running useEffect and dispatch get classroom");
    } else {
      dispatch(getEnrollments(token, userId));
    }
    // eslint-disable-next-line
  }, []);

  return (
    <>
      {enrollments &&
        enrollments.map((enrollment, key) => (
          <div className={styles.cards} key={key}>
            <Card
              name={enrollment.classroom_detail.name}
              teacher={enrollment.classroom_detail.teacher_name}
            />
          </div>
        ))}

      {is_teacher &&
        classrooms &&
        classrooms.map((classroom, key) => (
          <div className={styles.cards} key={key}>
            <Card name={classroom.name} teacher={classroom.teacher_name} />
          </div>
        ))}
    </>
  );
}

export default EnrollmentsList;
